import '../static/styles/UserJob.css'
import axios from 'axios'

function UserJob({ jobname, profileImage, endpoint_url }) {

    // Asyncrounously load Login & Register components instead of importing it always. -> performance increase 

    const handleClick = () => {
        axios.post("http://192.168.18.139:8080/job/test-job/build", 
        {
            auth:{
                username: "aswinrprasad",
                password: "devforlife"
            }
        }
        )
            .then(() => console.log("Build Done"))
            .catch((err) => console.log("Error occured. Error : " + err))
    }

    return (
        <div className="card">
            <img className="card-img-top" src={profileImage} alt=""></img>
            <div className="card-body">
                <h5 className="card-title">{jobname}</h5>
                <div className="card-text">
                    Job description <br /><hr />
                    <button type="button" className="btn btn-lg btn-info" onClick={handleClick}>Build Now</button>
                </div>
            </div>
        </div>
    )
}

export default UserJob
